import OnOffFieldGallery from '../components/OnOffFieldGallery';

const Home = () => {
  return (
    <div className="container">
      <h1>Welcome to Mario Stroeykens' Official Portfolio</h1>
      <p>
        Discover Mario’s journey both on and off the pitch — from professional triumphs to personal moments.
      </p>
      <OnOffFieldGallery />
    </div>
  );
};

export default Home;
